  false,\n\t\"url\": null,\n\t\"notes\": \"In 1990 sediment and water samples were
  collected at five outlets in Union Slough National Wildlife Refuge. Forty eight
  hour sediment bioassay results revealed larval fathead minnow mortality at two of
  the outlet sites. Water bioassays of the same time frame resulted in no larval fathead
  minnow mortality at any sampling site. Elevated concentrations of ammonia were the
  suspected causative agent during this phase of the study. In 1991 sediment sampling
  was continued at three of the same five outlet sites. Inorganic analysis of the
  sediments revealed the presence of eight metals in elevated concentrations. Trace
  amounts of four polynuclear aromatic hydrocarbons were detected at all three outlets.
  There were no organochlorine pesticide residues, no organophosphorus pesticides
  and no chlorophenoxy acid herbicides detected at any site during the sediment analysis.
  All of the outlet sites had elevated ammonia concentrations. Future studies are
  proposed to identify background concentrations of agricultural products and agriculture
  practices in the area, which may affect water quality.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
